import React from 'react';
import {Image } from 'react-bootstrap';
import Link from 'next/link'
import StyledSectionButton from '../components/StyledSectionButton';
import ButtonContainer from '../components/StyledButtonContainer';
import StyledJumbo from '../components/StyledJumbo';
import StyledContainer from '../components/StyledContainer';
import Head from 'next/head';
import Layout from '../components/Layout';
import TextBox from '../components/StyledTextBox';

const Home: React.FunctionComponent<{}> = (props) => {
    const welcome = [
        "I am a developer that could work for you.",
        " am a computer science student that wants to learn and but his skills to use."
    ]
    return (
        <Layout page="home">
            <Head>
                <title>Cutlip Development</title>
                <meta name="viewport" content="width=device-width, initial-scale=1.0" />
            </Head>
        <main>
        <StyledContainer>
        <Image src="/images/cover.png" alt="Cover Logo" width="90%" />
        </StyledContainer>
        <StyledJumbo>
        <TextBox title="Hi I'm Andrew Cutlip" />
        <p>I am a developer that could work for you.</p>
        <p>I am a computer science student that wants to learn and but his skills to use.</p>
        <p>Feel free to learn more about me</p>
        <p>See some of the work I have done</p>
        <p>Or see what skills I can offer you</p>
        <p>If you like what you see then feel free to contact me</p>
        <ButtonContainer hor="true">
            <Link href="/contact#service">
               <StyledSectionButton>Need a Developer?</StyledSectionButton>
            </Link>
            <Link href="/contact#hire">
               <StyledSectionButton>Hire Me</StyledSectionButton>
            </Link>
        </ButtonContainer>
        </StyledJumbo>
        </main>
        </Layout>
    )
}

export default Home;
